The invention relates  inter alia  to a compound of general formula  (I)  or  (I'),  or a pharmaceutically acceptable salt thereof, for use in the treatment of an inflammatory disorder:

wherein 
X 
z is 1,2 or 4; is -CO-Y k -(R 1 ) n  or SO 2 -Y k -(R 1 ) n ; k is 0 or 1; 
Y 
is a cycloalkyl or polycyloalkyl group (such as an adamantyl, adamantanemethyl, bicyclooctyl, cyclohexyl, cyclopropyl group); 

or is a cycloalkenyl or polycycloalkenyl group; 
each R 1  is independently selected from hydrogen or an alkyl, haloalkyl, alkoxy, haloalkoxy, alkenyl, alkynyl or alkylamino radical of 1 to 20 carbon atoms (for example of 5 to 20 carbon atoms, of 8 to 20 carbon atoms, of 9 to 20 carbon atoms, of 10 to 18 carbon atoms, of 12 to 18 carbon atoms, of 13 to 18 carbon atoms, of 14 to 18 carbon atoms, of 13 to 17 carbon atoms); 
or each R 1  is independently selected from fluoro, chloro, bromo, iodo, hydroxy, oxyalkyl, amino, aminoalkyl or aminodialkyl radical; and 
n is any integer from 1 to m, where m is the maximum number of substitutions permissible on the cyclo-group Y (such that n=1 if k=0, such that the R 1  group is bonded directly to the carbonyl or sulfonyl group); 
provided that simultaneously X cannot be an undec-10-en-1-oyl group and z be equal to 1 or 2; or 
alternatively R 1  is selected from a peptido radical having from 1 to 4 peptidic moieties linked together by peptide bonds.

The invention relates  inter alia  to a compound of general formula ( IV ):

wherein 
a and b are, independently, numbers between 3 and 6; 
L is a linker consisting of a linear or branched alkyl moiety consisting of between 2 and 20 carbon atoms; or a disubstituted cyclopentane (either 1,2 or 1,3 substituted), cyclohexane (either 1,2, 1,3 or 1,4 substituted) or other disubstitued cycloalkane or polycycloalkane, including adamantine, decalin or bicyclooctane where each substituent is a linear or branched alkyl moiety consisting of between 0 and 10 carbon atoms; or a disubstituted aromatic ring system, including benzyl (either meta, ortho or para disubstituted), pyridinyl, coumaryl, napthalenyl and pyrimidyl, where each substituent is a linear or branched alkyl moiety consisting of between 0 and 10 carbon atoms; 
C and D are independently chosen from H, linear or branched alkyl, haloalkyl, hydroxyalkyl radicals or cycloalkyl or polycycloalkyl radicals containing between 0 and 10 carbon atoms, or COZ where Z is chosen from H, OH, linear or branched alkyl, haloalkyl, hydroxyalkyl radicals or cycloalkyl or polycycloalkyl radicals containing between 0 and 10 carbon atoms; 
each R is a (potentially different) chemical moiety bearing a positive charge at physiological pH.

