Compounds of formula I, 

wherein 

R ^{ 1 } represents C _{ 1-4 } alkoxy optionally substituted by one or more fluorine atoms; 

R ^{ 2 } represents an aryl group or a heteroaryl group, optionally substituted by C _{ 1-4 } alkyl or SO _{ 2 } NH _{ 2 } ; 

R ^{ 3 } represents a 4-, 5-, 6-, or 7-membered heterocyclic ring containing at least one heteroatom selected from N, O and S, the ring being optionally fused to a benzene ring or a 5- or 6-membered heterocyclic ring containing at least one heteroatom selected from N, O and S, the ring system as a whole being optionally substituted; 

X represents CH or N; and 

L is absent, or represents a cyclic group of formula Ia, 

or represents a chain of formula Ib, 

and pharmaceutically acceptable salts thereof, are useful in the treatment of a variety of disorders including benign prostatic hyperplasia.

